import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './index.css'; // Ensure global styles are imported

const Rating = () => {
  const [form, setForm] = useState({
    lecture_id: '',
    target_id: '',
    rating: '',
    comment: ''
  });
  const [message, setMessage] = useState('');
  const [ratings, setRatings] = useState([]);

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const fetchRatings = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/rating`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setRatings(res.data.ratings || []);
    } catch (err) {
      console.error('Fetch ratings error:', err);
    }
  };

  useEffect(() => {
    fetchRatings();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        `${process.env.REACT_APP_API_URL}/rating`,
        form,
        { headers: { 'x-auth-token': localStorage.getItem('token') } }
      );
      setMessage(res.data.message);
      setRatings(res.data.ratings || []);
      setForm({ lecture_id: '', target_id: '', rating: '', comment: '' });
    } catch (err) {
      setMessage(err.response?.data?.message || 'Error submitting rating');
      console.error('Rating submit error:', err);
    }
  };

  return (
    <div className="rating-container">
      <div className="rating-form-card">
        <h3>Rate Student</h3>
        {message && <p className="rating-message">{message}</p>}

        <form onSubmit={handleSubmit} className="rating-form">
          <input
            type="text"
            name="lecture_id"
            placeholder="Lecture ID"
            value={form.lecture_id}
            onChange={handleChange}
            required
            className="rating-input"
          />
          <input
            type="text"
            name="target_id"
            placeholder="Student ID"
            value={form.target_id}
            onChange={handleChange}
            required
            className="rating-input"
          />
          <input
            type="number"
            name="rating"
            placeholder="Rating (1-5)"
            min="1"
            max="5"
            value={form.rating}
            onChange={handleChange}
            required
            className="rating-input"
          />
          <textarea
            name="comment"
            placeholder="Comment (optional)"
            value={form.comment}
            onChange={handleChange}
            className="rating-textarea"
          />
          <button type="submit" className="rating-submit-btn">Submit Rating</button>
        </form>
      </div>

      <h3>All Ratings</h3>
      <div className="ratings-list">
        {ratings.length > 0 ? ratings.map((r) => (
          <div key={r.id} className="rating-card">
            <p><strong>Lecture ID:</strong> {r.lecture_id}</p>
            <p><strong>Student ID:</strong> {r.student_id}</p>
            <p><strong>Lecturer ID:</strong> {r.lecturer_id}</p>
            <p><strong>Rating:</strong> {r.rating}</p>
            <p><strong>Comment:</strong> {r.comment || '-'}</p>
          </div>
        )) : <p>No ratings yet.</p>}
      </div>
    </div>
  );
};

export default Rating;
